import Meme from "./logo-image/Meme.png";

function HomePage() {
  return (
    <div className="container d-flex justify-content-center">
      <Link to={"homepage"} className="navbar-brand">
        <img src={Meme} alt="stupify" height="70%" width="70%"></img>
      </Link>
    </div>
  );
}

export default HomePage;
